// import './App.css';
import { useState, useEffect } from 'react';
import './style.css';
import 'boxicons/css/boxicons.min.css';


function SideBar() {
    const [arrow, setArrow] = useState(document.querySelectorAll(".arrow"));
    const [sidebar, setSidebar] = useState(document.querySelector(".sidebar"));
    const [sidebarBtn, setSidebarBtn] = useState(document.querySelector(".bx-menu"));

    useEffect(() => {
        // let arrow = document.querySelectorAll(".arrow");
